/*Of the attached borrowers, please provide the following
AAC
= Sring all distinct values in:  LNXX.LC_STA_LONXX

STATUS	
= String all distinct values in:  DWXX.WC_DW_LON_STA

Separate borrowers into the following reports:

RX = Open, Fixed
	RPS_DATE => XX/XX/XXXX AND PRINCIPAL > X.XX
	   
RX = Closed
	PRINCIPAL <= X.XX
	   
RX = Open, Not Fixed
	All others 

Jesse Gutierrez - XX/XX/XXXX XX:XX PM - Review

Issue:
We need to identify the following values for the attached population of original borrowers monitored by FSA:

SSN, First Name, Last Name, Loan Status, Prinicpal, Interest, Last payment amount (pull from billing), current payment amount (pull from rps), and last redisclosure date.*/

SELECT * FROM OPENQUERY(LEGEND,
'
	SELECT DISTINCT
		PDXX.DM_PRS_X AS F_NAME,
		PDXX.DM_PRS_LST AS L_NAME,
		LNXX.BF_SSN AS SSN,
		LNXX.LN_SEQ AS LOAN,
		FSXX.LF_FED_AWD	AS AWARD_ID,
		FSXX.LN_FED_AWD_SEQ AS AWARD_ID_SEQ,
		LNXX.LC_STA_LONXX AS AAC,
		LNXX.LC_SST_LONXX AS AAC_SUB,
		DWXX.WC_DW_LON_STA AS STATUS,
		LNXX.LA_CUR_PRI AS CURR_PRINCIPAL,
		DWXX.WA_TOT_BRI_OTS AS CURR_INTEREST,
		LNXXMin.FIRST_RPS AS FIRST_RPS,
		LNXXInt.FIRST_RPS_INTEREST AS INTEREST_AT_FIRST_RPS,
		LNXXMax.RPS_DATE AS CURR_RPS_DATE,
		LNXXSCH.LC_TYP_SCH_DIS AS CURR_RPS_PLAN,
		LNXX.CURR_PMT AS CURR_RPS_PMT,
		LNXX.LAST_PMT AS PMT_PRIOR_TO_CURR_RPS		
	FROM
		PKUB.LNXX_LON LNXX
		INNER JOIN PKUB.PDXX_PRS_NME PDXX
			ON PDXX.DF_PRS_ID = LNXX.BF_SSN
		INNER JOIN PKUB.DWXX_DW_CLC_CLU DWXX
			ON DWXX.BF_SSN = LNXX.BF_SSN
			AND DWXX.LN_SEQ = LNXX.LN_SEQ
		INNER JOIN PKUB.FSXX_DL_LON	FSXX
			ON LNXX.BF_SSN = FSXX.BF_SSN
			AND LNXX.LN_SEQ = FSXX.LN_SEQ
		LEFT OUTER JOIN 
		(
			SELECT
				BF_SSN,
				LN_SEQ,
				MIN(LD_CRT_LONXX) AS FIRST_RPS
			FROM
				PKUB.LNXX_LON_RPS 
			WHERE
				LD_CRT_LONXX >= ''XXXX-XX-XX''
			GROUP BY
				BF_SSN,
				LN_SEQ
		) LNXXMin
			ON LNXXMin.BF_SSN = LNXX.BF_SSN
			AND LNXXMin.LN_SEQ = LNXX.LN_SEQ
		LEFT OUTER JOIN
		(
			SELECT
				BF_SSN,
				LN_SEQ,
				LA_ACR_INT_RPD AS FIRST_RPS_INTEREST,
				LD_CRT_LONXX
			FROM
				PKUB.LNXX_LON_RPS 
		) LNXXInt
			ON LNXXInt.BF_SSN = LNXX.BF_SSN
			AND LNXXInt.LN_SEQ = LNXX.LN_SEQ
			AND LNXXInt.LD_CRT_LONXX = LNXXMin.FIRST_RPS
		LEFT OUTER JOIN 
		(
			SELECT
				BF_SSN,
				LN_SEQ,
				MAX(LN_RPS_SEQ) AS LN_RPS_SEQ,
				MAX(LD_CRT_LONXX) AS RPS_DATE
			FROM
				PKUB.LNXX_LON_RPS 
			GROUP BY
				BF_SSN,
				LN_SEQ
		) LNXXMax
			ON LNXXMax.BF_SSN = LNXX.BF_SSN
			AND LNXXMax.LN_SEQ = LNXX.LN_SEQ
		LEFT OUTER JOIN 
		(
			SELECT
				BF_SSN,
				LN_SEQ,
				LN_RPS_SEQ,
				LD_CRT_LONXX,
				LC_TYP_SCH_DIS
			FROM
				PKUB.LNXX_LON_RPS 
		) LNXXSCH
			ON LNXXSCH.BF_SSN = LNXX.BF_SSN
			AND LNXXSCH.LN_SEQ = LNXX.LN_SEQ
			AND LNXXSCH.LD_CRT_LONXX = LNXXMax.RPS_DATE
		LEFT OUTER JOIN
		(
			SELECT
				BF_SSN,
				LN_SEQ,
				LN_RPS_SEQ,
				LA_RPS_ISL AS CURR_PMT
			FROM
				PKUB.LNXX_LON_RPS_SPF 
			WHERE
				LN_GRD_RPS_SEQ = X
		) LNXX
			ON LNXXMax.BF_SSN = LNXX.BF_SSN
			AND LNXXMax.LN_SEQ = LNXX.LN_SEQ
			AND LNXXMax.LN_RPS_SEQ = LNXX.LN_RPS_SEQ
		LEFT OUTER JOIN
		(
			SELECT
				LNXX_P.BF_SSN,
				LNXX_P.LN_SEQ,
				LNXX_P.LA_BIL_CUR_DU AS LAST_PMT
			FROM
				PKUB.LNXX_LON_BIL_CRF LNXX_P
				INNER JOIN 
				(
					SELECT
						LNXX.BF_SSN,
						LNXX.LN_SEQ,
						MAX(LNXX.LD_BIL_DU_LON) AS LD_BIL_DU_LON
					FROM
						PKUB.LNXX_LON_BIL_CRF LNXX
						LEFT OUTER JOIN 
						(
							SELECT
								BF_SSN,
								LN_SEQ,
								MAX(LN_RPS_SEQ) AS LN_RPS_SEQ,
								MAX(LD_CRT_LONXX) AS RPS_DATE
							FROM
								PKUB.LNXX_LON_RPS 
							GROUP BY
								BF_SSN,
								LN_SEQ
						) LNXXCurrRPS
							ON LNXXCurrRPS.BF_SSN = LNXX.BF_SSN
							AND LNXXCurrRPS.LN_SEQ = LNXX.LN_SEQ
					WHERE
						LNXX.LC_BIL_TYP_LON = ''P''
						AND LNXX.LD_BIL_DU_LON < LNXXCurrRPS.RPS_DATE
					GROUP BY
						LNXX.BF_SSN,
						LNXX.LN_SEQ
				) LNXXMax 
					ON LNXXMax.BF_SSN = LNXX_P.BF_SSN
					AND LNXXMax.LN_SEQ = LNXX_P.LN_SEQ
					AND LNXXMax.LD_BIL_DU_LON = LNXX_P.LD_BIL_DU_LON
			WHERE
				LNXX_P.LC_BIL_TYP_LON = ''P''
		) LNXX
			ON LNXX.BF_SSN = LNXX.BF_SSN
			AND LNXX.LN_SEQ = LNXX.LN_SEQ
'
) WHERE SSN IN ('XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXXXXXXXX','XXX